import React, { useState } from 'react'
// import useReactRouter from 'use-react-router'
import { Card, Button } from 'antd'
import ListTable from './components/ListTable'
import { employees } from '../../utils/constants'
import { employeeAddPage } from '../../routes/urls'
const data = employees
const EmployeeList = (props) => {
  // const { history } = useReactRouter()
  const [employees, setEmployees] = useState(data)
  const onAdd = () => {
    props.history.push(employeeAddPage, { style: 'add' })
    // history.push('/employee/add', { style: 'add' })
  }
  const title = (
    <>
      <Button type="primary" onClick={onAdd} style={{ float: 'right' }}>
        Add
      </Button>
    </>
  )
  return (
    <>
      <h2>Employee List Page</h2>
      <Card title={title}>
        <ListTable
          employees={employees}
          history={props.history}

          // roleNames={roleNames}
          // getUsers={getUsers}
          // openUserForm={(user) => openUserForm('edit', user)}
          // handleCancel={handleCancel}
        />
      </Card>
    </>
  )
}
export default EmployeeList
